In this section of the tutorial, you will create a library to handle image manipulation. This library will have exactly one function. It should: Take a field of bytes representing an image Take a filter type It should not: Handle any I/O Do input parsing (like filter name detection, etc.) ✅ In image-manipulation/Cargo.toml, add: [dependencies]
rustagram2 = "2"
log = "0.4" We use the log crate to get some visibility into what is happening. ✅ In image-manipulation/src/lib.rs, add the following imports and function headers use std::io::Cursor; use rustagram::image::io::Reader;
use rustagram::image::ImageOutputFormat;
use rustagram::{RustagramFilter, FilterType}; pub fn apply_filter(img: &[u8], filter: FilterType) -> Vec<u8> { log::debug!("image: {} bytes, filter: {:?}", img.len(), filter);
} This communicates three interesting things: The function is marked pub - this makes it a public function, callable from other libraries. The default in Rust is always private. The data of the image is an immutable reference to binary data owned outside of the function The result is a binary vector, but passed out owned - so it cannot be the initial data

